Head punctation consists of coarse setigerous punctures. Antenna robust, last antennomere 1.60–1.85 times as long as wide (
Fig. 39
), its ventral side smooth with numerous small tubercles.

Pronotum largely transverse, ca. 2.05–2.26 times as wide as long. Sides almost regularly rounded (
Fig. 16
). The disc with two rounded shallow depressions. Punctation consists of moderately large and sparse setigerous punctures on the disc, and coarser and denser punctures laterally.

Male. Aedeagus with phallobase longer than parameres. Parameres simple, their subbasal and subapical hook well developed. Median lobe subparallel, narrowed slightly to the apex (
Fig. 23
).
